import React from 'react';

const Banner = () => {
  return (
    <section id='banner'>
      <div class='foto'></div>
      <h1>Luis Jubal Smith</h1>
      <p>Web Developer - Front End - User Experience Designer</p>
    </section>
  );
};

export default Banner;
